import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from './component/header'
import  './css/style.css'
import  './css/sub-style.css'
import SideMenu from "./component/sidemenu";
import Dash from "./component/dashbord";
import Myappac from "./component/my-appac";
import na from "./component/nav";




function main() {
  return (<div>
    <Header/>
    <div className="body">
    <div><SideMenu/></div>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Dash />}>
          <Route path="/my-appac" element={< Myappac/>} />
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
    </div>
  )
}

export default main
